export const TrainTable=(data: {id:number,sorozat:string,becenev:string,gyarto:string,maxSebesseg:number}[])=>{
    return data.map((train)=>(
        <tr key={train.id} className="hover:bg-slate-400">
            <td>{train.sorozat}</td>
            <td>{train.becenev}</td>
            <td>{train.gyarto}</td>
            <td>{train.maxSebesseg}</td>
        </tr>
    ))
}
